import React from 'react';
import './App.css';

function App() {
  return (
    <div style={styles.container}>
      {/* 상단 네비게이션 바 */}
      <nav style={styles.navbar}>
        <a style={styles.navItem} href="#agents">요원</a>
        <a style={styles.navItem} href="#map-rotation">맵 로테이션</a>
        <a style={styles.navItem} href="#rank">랭크</a>
        <a style={styles.navItem} href="#esports">E-Sports</a>
      </nav>

      {/* 메인 콘텐츠 */}
      <div style={styles.main}>
        <h1 style={styles.title}>INFOV</h1>

        <div style={styles.searchSection}>
          <input
            type="text"
            placeholder="아이디를 입력해주세요 ex.) CU24#편의점"
            style={styles.input}
          />
          <select style={styles.select}>
            <option value="asia">아시아 서버</option>
            <option value="kr">한국 서버</option>
            <option value="cn">중국 서버</option>
            <option value="na">미국 서버</option>
            <option value="eu">유럽 서버</option>
          </select>
        </div>
      </div>

      {/* 각 섹션 */}
      <AgentsSection />
      <MapRotationSection />
      <RankSection />
      <EsportsSection />
    </div>
  );
}

// Section 컴포넌트들
function AgentsSection() {
  return (
    <div id="agents" style={styles.section}>
      <h2>요원</h2>
    </div>
  );
}

function MapRotationSection() {
  return (
    <div id="map-rotation" style={styles.section}>
      <h2>맵 로테이션</h2>
    </div>
  );
}

function RankSection() {
  return (
    <div id="rank" style={styles.section}>
      <h2>랭크</h2>
    </div>
  );
}

function EsportsSection() {
  return (
    <div id="esports" style={styles.section}>
      <h2>E-Sports</h2>
    </div>
  );
}

const styles = {
  container: {
    backgroundColor: '#0f0f0f',
    color: 'white',
    fontFamily: 'Black Han Sans, sans-serif',
  },
  navbar: {
    width: '100%',
    display: 'flex',
    justifyContent: 'center',
    padding: '20px 0',
    backgroundColor: '#1a1a1a',
    position: 'fixed',
    top: 0,
    zIndex: 1000,
  },
  navItem: {
    color: '#fff',
    margin: '0 20px',
    textDecoration: 'none',
    fontSize: '18px',
    fontWeight: 'bold',
  },
  main: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    paddingTop: '120px',
  },
  title: {
    fontSize: '72px',
    fontWeight: 'bold',
    marginBottom: '30px',
  },
  searchSection: {
    display: 'flex',
    gap: '10px',
    alignItems: 'center',
  },
  input: {
    width: '300px',
    height: '40px',
    fontSize: '16px',
    padding: '0 10px',
    borderRadius: '5px',
    border: 'none',
    outline: 'none',
  },
  select: {
    height: '40px',
    fontSize: '16px',
    padding: '0 10px',
    borderRadius: '5px',
    border: 'none',
  },
  section: {
    height: '100vh',
    padding: '100px 20px',
  },
};

export default App;
